export default class campuses extends Component {
    render() {
        return (
            <div>
                <Link style = {linkStylehead} to = "/" className = "CPbtn">Kent Ridge Campus</Link>
                <Link style = {linkStylehead} to = "/" className = "CPbtn">Utown</Link>
                <Link style = {linkStylehead} to = "/" className = "CPbtn">Bukit Timah Campus</Link>
            </div>
        )
    }
}
